import React from 'react';

const Filters = ({ handleFilter }) => {
	return (
		<aside>
			<label htmlFor="less">Less than:</label>
			<input type="number" name="less" onChange={(e) => handleFilter(e.target.name, e.target.value)} />
		</aside>
	);
};

export default Filters;
